{"operationName":"DiscoverVaults","variables":{"currency":"usd","first":10,"network":"ethereum"},"query":"query DiscoverVaults($currency: Currency!, $first: Int!, $network: Deployment!) {
  topGainers: vaultList(
    currency: $currency
    first: $first
    network: $network
    orderBy: TOP_GAINERS
  ) {
    nodes {
      name
      address
      valid
      nsvCurrent
      gavCurrent
      numberOfDepositors
      performance24h
      __typename
    }
    __typename
  }
  latest: vaultList(
    currency: $currency
    first: $first
    network: $network
    orderBy: LATEST_VAULTS
  ) {
    nodes {
      name
      address
      valid
      nsvCurrent
      gavCurrent
      numberOfDepositors
      performance24h
      __typename
    }
    __typename
  }
  mostPopular: vaultList(
    currency: $currency
    first: $first
    network: $network
    orderBy: MOST_POPULAR
  ) {
    nodes {
      name
      address
      valid
      nsvCurrent
      gavCurrent
      numberOfDepositors
      performance24h
      __typename
    }
    __typename
  }
  largest: vaultList(currency: $currency, first: $first, network: $network) {
    nodes {
      name
      address
      valid
      nsvCurrent
      gavCurrent
      numberOfDepositors
      performance24h
      __typename
    }
    __typename
  }
}"}

